import React from 'react';
import { Link, Page } from 'components';

const Home = () => {
    return (
        <Page>
            <Link to="ROUTE:COMPONENT:DETAILS" params={{ key: 'switch' }}>
                GO TO UI COMPONENTS
          </Link>
        </Page>
    );
};

export default Home;
